import React from "react";

// import { Container } from './styles';

const TodoList = () =>
  <div id="TodoList">
    <h1>Sua lista de compras</h1>
    <form>
      <input type="checkbox" name="name" />
      <label>
        Name:
      </label>
      <input type="checkbox" />
    </form>
  </div>
  ;

export default TodoList;
